import React from "react"
import {NavLink} from "react-router-dom"
import Home from '../Pages/Home'

function Header () {
    return (
        <nav>
            <NavLink exact activeClassName= "active" to="/">
                {Home}
            </NavLink>
            <NavLink activeClassName= "active" to= "/">
                Images
            </NavLink>
            <NavLink activeClassName= "active" to= "/">
                About
            </NavLink>
        </nav>
    );
}

export default Header;
